// App.js
import React from "react";
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import About from "./components/About";
import Experience from "./components/Experience";
import Contact from "./components/Contact";
import Navbar from "./components/Navbar";
import Projects from "./components/Projects";
import Skills from "./components/Skills";
import Provenance from "./components/Provenance"; 
import PeopleWeave from "./components/PeopleWeave";
import TeamTech from "./components/TeamTech";
import ResearchBlog from "./components/Research Blog";
import "./App.css"; 


export default function App() {
  return (
    <BrowserRouter>
      <main>
        <div className="app-container">
          <Navbar />
          <Routes>
            <Route path="/" element={
              <>
                <div className="about-section">
                  <About />
                </div>
                <div className="skills">
                  <Skills />
                </div>
                <div className="projects-section">
                  <Projects />
                </div>
                <div className="experience-section">
                  <Experience />
                </div>
                <div>
                  <Contact />
                </div>
              </>
            } />
            <Route path="/provenance" element={<Provenance />} /> {/* Route to Provenance component */}
            <Route path="/peopleweave" element={<PeopleWeave />} /> {/* Route to PeopleWeave component */}
            <Route path="/teamtech" element={<TeamTech />} />
            {/* Add more routes for other projects as needed */}
          </Routes>
        </div>
      </main>
    </BrowserRouter>
  );
}
